import Modal from 'react-modal';

const Cards = ({modalIsOpen}) => {
    return (
        <Modal ClassName="modal" isOpen={modalIsOpen}>
            <button type="button" class="close" data-dismiss="modal" aria-label="Close" on >
                <span aria-hidden="true">&times;</span>
            </button>
            <h2>Descargar cartones:</h2>
            <span>Links</span>
        </Modal>
    )
}

export default Cards;
